pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

contract Consortium {

    struct Vote {
        bool exists;
        uint8 count;
        mapping(address => bool) votes;
    }

    struct FeeVote {
        bool exists;
        uint256 openFee;
        uint256 issueFee;
        uint256 updateFee;
        uint256 transferFee;
        uint256 publisherFee;
    }

    // global fee's
    uint256 public openFee = 50;
    uint256 public issueFee = 100;
    uint256 public updateFee = 10;
    uint256 public transferFee = 1;
    uint256 public publisherFee = 1;

    // fee vote
    mapping(address => FeeVote) private feeVotes;

    uint8 private memberCount;
    address[10] private members;
    mapping(address => Vote) private proposals;

    constructor(address[10] memory inital) public payable{
        members = inital;
        memberCount = 10;
        // generate inital votes
        for (uint8 i = 0; i < 10; i++) {

            Vote memory newVote;
            newVote.exists = true;
            newVote.count = 10;
            proposals[inital[i]] = newVote;

            for (uint8 d = 0; d < 10; d++) {
                proposals[inital[i]].votes[inital[d]] = true;
            }
        }
    }

    function vote(address member, bool voting) public payable returns (bool){

        // check if voter is part of current members
        bool _isMember = isMember(msg.sender);
        require(_isMember, "Only members are allowed to vote");

        // check if less then 7 active members then ignore down-vote
        // only up-votes are allowed
        require(
            !(memberCount < 7 && voting == false),
            "Less then 7 active members, down-votes not anymore allowed"
        );

        // add vote for member
        if (proposals[member].exists == false) {
            Vote memory newVote;
            newVote.exists = true;
            proposals[member] = newVote;
        }

        // check if voter already voted
        bool voted = proposals[member].votes[msg.sender];
        proposals[member].votes[msg.sender] = voting;
        if (voting && !voted) {
            proposals[member].count++;
        } else if (!voting && voted) {
            proposals[member].count--;
        }

        // if member has more then 5 positive votes add to members
        // only works if before some member was removed because less then
        // 5 votes left

        // check which of the current members has less then 5 votes
        // and remove him from the list
        for (uint i = 0; i < memberCount; i++) {
            if (proposals[members[i]].count < 5) {
                if (i != (memberCount - 1)) {
                    members[i] = members[memberCount - 1];
                    delete members[memberCount - 1];
                    memberCount--;
                } else {
                    delete members[memberCount - 1];
                    memberCount--;
                }
            }
        }

        // check if the current voted member reached more then 5
        if (proposals[member].count >= 5) {
            // check if he is maybe already member ?
            bool __isMember = isMember(member);
            if (!__isMember) {// he is not a member => add him now

                // check if there might be no space (nobody was down-voted)
                if (memberCount == 10) revert("Upvoted member can't be added, already 10 delegated");
                //require()

                // add new member
                members[memberCount] = member;
                memberCount++;

                // add fee vote to average
                FeeVote memory newFeeVote;
                newFeeVote.openFee = openFee;
                newFeeVote.issueFee = issueFee;
                newFeeVote.updateFee = updateFee;
                newFeeVote.transferFee = transferFee;
                newFeeVote.publisherFee = publisherFee;
                feeVotes[msg.sender] = newFeeVote;
            }
        }

        return true;
    }

    function getSize() public view returns (uint256){
        return memberCount;
    }

    // get current members
    function getMembers() public view returns (address[10] memory){
        return members;
    }

    // check current vote of a member / future member
    function getMemberVote(address member) public view returns (uint8){
        return proposals[member].count;
    }

    // check if an address is in the members array
    function isMember(address member) public view returns (bool){
        bool found = false;
        for (uint i = 0; i < memberCount; i++) {
            if (member == members[i])
                found = true;
        }
        return found;
    }

    // check if an address is in the members array
    modifier _isMember(address member) {
        bool memberFound = isMember(member);
        require(memberFound, "Only members are allowed to change fee's");
        _;
    }


    // ----------------------------------------------------------------------------------------------------------
    // --------------------------------------------- FEE'S CONTROL ----------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    // set open fee
    function voteOpenFee(uint16 amount) public _isMember(msg.sender) {
        feeVotes[msg.sender].openFee = amount;
        recalculateFees();
    }

    // set issue fee
    function voteIssueFee(uint16 amount) public _isMember(msg.sender) {
        feeVotes[msg.sender].issueFee = amount;
        recalculateFees();
    }

    // set transfer fee
    function voteTransferFee(uint16 amount) public _isMember(msg.sender) {
        feeVotes[msg.sender].transferFee = amount;
        recalculateFees();
    }

    // set update fee
    function voteUpdateFee(uint16 amount) public _isMember(msg.sender) {
        feeVotes[msg.sender].updateFee = amount;
        recalculateFees();
    }

    // set publiser fee
    function votePublisherFee(uint16 amount) public _isMember(msg.sender) {
        feeVotes[msg.sender].publisherFee = amount;
        recalculateFees();
    }

    // Calculate average of all members fee votes
    function recalculateFees() internal {
        uint256 _openFee;
        uint256 _issueFee;
        uint256 _updateFee;
        uint256 _transferFee;
        uint256 _publisherFee;

        for (uint i = 0; i < memberCount; i++) {
            _openFee += feeVotes[members[i]].openFee;
            _issueFee += feeVotes[members[i]].issueFee;
            _updateFee += feeVotes[members[i]].updateFee;
            _transferFee += feeVotes[members[i]].transferFee;
            _publisherFee += feeVotes[members[i]].publisherFee;
        }

        openFee = _openFee / memberCount;
        issueFee = _issueFee / memberCount;
        updateFee = _updateFee / memberCount;
        transferFee = _transferFee / memberCount;
        publisherFee = _publisherFee / memberCount;
    }

}
